import React, {useState, useEffect} from "react";

const BooksOverview = () => {
    const [books, setBooks] = useState({});

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await fetch("/book");
                const json = await response.json();
                setBooks({
                    "books": json.result
                });
            } catch (error) {
                console.log(error);
            }
        }

        fetchData();
    }, []);

    return (
        <>
            {console.log(books[0])}
        </>
    );
}

export default BooksOverview;
